import React, { useState } from 'react';
import ConfettiExplosion from 'react-confetti-explosion';
import { evaluate } from 'mathjs';
import './App.css';


function App() {
  const [input, setInput] = useState('');
  const [showExplosion, setShowExplosion] = useState(false);

  const handleButtonClick = (value) => {
    setInput(input + value);
  };

  const handleClear = () => {
    setInput('');
  };

  const handleEvaluate = () => {
    try {
      let result = evaluate(input);
      // Check for 5 and 6 in the expression to trigger confetti
      if (/5.*6|6.*5/.test(input)) {
        setShowExplosion(true);
        setTimeout(() => setShowExplosion(false), 2000);
      }
      setInput(result.toString());
    } catch (error) {
      setInput('Error');
    }
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter') {
      handleEvaluate();
    } else if (e.key === 'Escape') {
      handleClear();
    }
  };
  const handleSpecialFunction = (func) => {
    try {
      setExpression((prev) => math[func](math.evaluate(prev)).toString());
    } catch (error) {
      setExpression('Error');
    }
  };
  const handleClick = (value) => {
    setExpression((prev) => prev + value);
  };



  React.useEffect(() => {
    window.addEventListener('keydown', handleKeyPress);
    return () => {
      window.removeEventListener('keydown', handleKeyPress);
    };
  }, [input]);

  const handleDegreeToggle = () => {
    const radianMode = input.includes('deg') ? 'rad' : 'deg';
    setInput(input.replace(/deg|rad/g, radianMode));
  };
  const handleChangeSign = () => {
    try {
      setExpression((prev) => {
        if (prev) {
          const evaluated = math.evaluate(prev);
          return (evaluated * -1).toString();
        }
        return prev;
      });
    } catch (error) {
      setExpression('Error');
    }
  };



  return (
    <div className="App">
      <header className="App-header">
        <h1>Today pay assessment</h1>
        <input type="text" value={input} readOnly />
        {showExplosion && <ConfettiExplosion />}
        <div className="buttons">
        <button onClick={handleClear}>C</button>

        <button onClick={() => handleButtonClick('/')}>/</button>
        <button onClick={handleChangeSign}>±</button>
          <button onClick={() => handleButtonClick('7')}>7</button>
          <button onClick={() => handleButtonClick('8')}>8</button>
          <button onClick={() => handleButtonClick('9')}>9</button>
          <button onClick={() => handleButtonClick('4')}>4</button>
          <button onClick={() => handleButtonClick('5')}>5</button>
          <button onClick={() => handleButtonClick('6')}>6</button>
          <button onClick={() => handleButtonClick('*')}>*</button>
          <button onClick={() => handleButtonClick('1')}>1</button>
          <button onClick={() => handleButtonClick('2')}>2</button>
          <button onClick={() => handleButtonClick('3')}>3</button>
          <button onClick={() => handleButtonClick('-')}>-</button>
          <button onClick={() => handleButtonClick('0')}>0</button>
          <button onClick={() => handleButtonClick('.')}>.</button>

          <button onClick={() => handleButtonClick('+')}>+</button>
          <button onClick={() => handleButtonClick('(')}>(</button>
          <button onClick={() => handleButtonClick(')')}> ) </button>
          <button onClick={handleEvaluate}>=</button>
          <button onClick={() => handleButtonClick('sin(')}>sin</button>
          <button onClick={() => handleButtonClick('cos(')}>cos</button>
          <button onClick={() => handleButtonClick('tan(')}>tan</button>
          <button onClick={() => handleButtonClick('log(')}>log</button>
          <button onClick={() => handleButtonClick('^')}>^</button>
          <button onClick={() => handleButtonClick('sqrt(')}>√</button>
          <button onClick={() => handleButtonClick('random()')}>Random</button>
          <button onClick={handleDegreeToggle}>Deg/Rad</button>
        </div>
      </header>
    </div>
  );
}

export default App;
